import { Basil, Edge, Clickons, Circum } from "../icons/index"

export interface Icon {
    name: string
    paths: {
        id: number
        style: string
        path: string
    }[]
    pack: string
    category?: string
    tags?: string[]
    toSVG: (id: number) => string
}

class icon implements Icon {
    name: string
    paths: {
        id: number
        style: string
        path: string
    }[]
    pack: string
    category?: string
    tags?: string[]

    constructor(name: string, paths: { id: number, style: string, path: string }[], pack: string, category?: string, tags?: string[]) {
        this.name = name
        this.paths = paths
        this.pack = pack
        this.category = category
        this.tags = tags
    }

    toSVG(id: number): string {
        for (const path of this.paths) {
            if (path.id === id)
                return ('<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24s 24" fill="none">' + path.path + '</svg>')
        }
    };
}

